  false,\n\t\"url\": null,\n\t\"notes\": \"The National Marine Mammal Laboratories'
  California Current Ecosystem Program (AFSC/NOAA) initiated a long-term marking program
  of northern fur seals (Callorhinus ursinus) at San Miguel Island, California in
  1975. A sample of up to 300 pups has been tagged in the foreflippers with various
  types and colors of tags each year between 1975 and the present. Resighting surveys
  for marked animals are conducted annually at summer breeding sites. Resightings
  are also obtained from the public when animals are observed on beaches or in fisheries.
  The data are used in mark-recapture models to estimate the age and sex specific
  vital parameters of the population and to describe age and sex specific reproductive
  behavior and seasonal movements of animals throughout their lives.\",\n\t\"license_title\":
